这个页面记录了所有舰娘的各项属性，点击表头可以进行排序。

== 属性说明 ==

火力、装甲、鱼雷、对空为满强化时的数值，回避、索敌、对潜为100级时的数值，幸运为未婚时的数值。

补给燃料和补给弹药指的是燃料、弹药耗尽时补给所需的资源，修理燃料和修理钢材则是指舰娘每受到一点伤害时修理所需要消耗的资源。

所有属性均不计技能影响。

<br/>查看改造后的技能,请到 [[战舰少女/技能系统|技能系统]]	
